// SPDX-License-Identifier: MIT
// Declarao do contrato
pragma solidity ^0.8.0;

// Definio do contrato
contract CarbonCreditTrading {
    // Variveis do contrato
    address public owner;
    mapping(address => uint) public balances;

    // Evento de transferncia de tokens
    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    // Construtor do contrato
    constructor() {
        owner = msg.sender;
    }

    // Funo de compra de crditos de carbono
    function buyCarbonCredits(uint256 _amount) public payable {
        // Verifica se o valor enviado  igual ao valor necessrio
        require(msg.value == _amount, "Valor incorreto");

        // Transfere crditos de carbono para o comprador
        balances[msg.sender] += _amount;

        // Emite evento de transferncia
        emit Transfer(address(this), msg.sender, _amount);
    }

    // Funo de venda de crditos de carbono
    function sellCarbonCredits(uint256 _amount) public {
        // Verifica se o comprador tem crditos de carbono suficientes
        require(balances[msg.sender] >= _amount, "Saldo insuficiente");

        // Transfere stablecoin para o vendedor
        payable(msg.sender).transfer(_amount);

        // Subtrai crditos de carbono do vendedor
        balances[msg.sender] -= _amount;

        // Emite evento de transferncia
        emit Transfer(msg.sender, address(this), _amount);
    }
}
